Added ut-s for this fix.
 @eyurtsev

Expressing gratitude to the creator for crafting this remarkable application. 🙌, Would like to Enhance grammar and spelling in the documentation for a polished reader experience.

Your feedback is valuable as always 

@baskaryan , @hwchase17 , @eyurtsev

- added `PubMed Document Loader` artifacts; ut-s; examples 
- fixed `PubMed utility`; ut-s

@hwchase17

  - Description:  ConsoleCallbackHandler, the callback used by langchain.debug, logs responses by OpenAI function calling but does not log the `functions` parameter in the request which makes debugging difficult. This PR adds a `functions` key with the functions in the request along side the `prompts` key.
  - Issue: -
  - Dependencies: -
  - Tag maintainer: @agola11
  - Twitter handle: @finnless

